#include <iostream>
#include <queue>
using namespace std;

const int n = 100;

int g[n][n];
int dist[n];
bool visited[n];

void bfs(int s, int n) {
    queue<int> q;

    for (int i = 0; i < n; i++) {
        dist[i] = -1;
        visited[i] = false;
    }
    q.push(s);
    dist[s] = 0;
    visited[s] = true;


    while (!q.empty()) {
        int u = q.front();
        q.pop();
        cout<<endl;
        cout<<u<<" ";


        for (int v = 0; v < n; v++) {
            if (g[u][v] && !visited[v]) {
                visited[v] = true;
                dist[v] = dist[u] + 1;
                q.push(v);
            }
        }
    }
}

int main() {
    int n, m;
    int u, v;
    cin >> n >> m;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            g[i][j] = 0;
        }
    }
    for (int i = 0; i < m; i++) {
        cin >> u >> v;
        g[u][v] = g[v][u] = 1;
    }

    for(int i=0;i<n;i++){
        for(int j=0;j<n;j++){
            cout<<g[i][j]<<" ";
        }
        cout<<endl;
    }

    bfs(0, n);

   cout<<endl;
    for (int i = 0; i < n; i++) {
        cout << "Distance of vertex " << i << " from the source: " << dist[i] << endl;
    }

    return 0;
}

